// Mock data for development
const generateArchitecture = async (difficulty) => {
  // Simulated API delay
  await new Promise(resolve => setTimeout(resolve, 500));

  return {
    architecture: {
      services: [
        { 
          id: 'lambda', 
          name: 'AWS Lambda', 
          icon: '/aws-icons/Arch_AWS-Lambda_48.svg'
        },
        { 
          id: 's3', 
          name: 'Amazon S3', 
          icon: '/aws-icons/Arch_Amazon-Simple-Storage-Service_48.svg'
        },
        { 
          id: 'ec2', 
          name: 'Amazon EC2', 
          icon: '/aws-icons/Arch_Amazon-EC2_48.svg'
        }
      ],
      connections: [
        { from: 'lambda', to: 's3' },
        { from: 'ec2', to: 's3' }
      ]
    },
    question: {
      text: 'Which compute service would you use for serverless architecture?',
      missingServices: ['lambda']
    },
    options: [
      { 
        id: 'lambda', 
        name: 'AWS Lambda', 
        icon: '/aws-icons/Arch_AWS-Lambda_48.svg'
      },
      { 
        id: 'ec2', 
        name: 'Amazon EC2', 
        icon: '/aws-icons/Arch_Amazon-EC2_48.svg'
      },
      { 
        id: 'ecs', 
        name: 'Amazon ECS', 
        icon: '/aws-icons/Arch_Amazon-Elastic-Container-Service_48.svg'
      }
    ]
  };
};

export { generateArchitecture };
